<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Error</title>

    <style>

        .ci-error-content{
            padding: 20px;
            width: max-content;

            position: relative;
            background-color: #fff;
   
            
            max-width: 676px;

            margin: 5% auto;
        }

        .ci-error-content svg{
            margin: 0 auto;
            display: block;
        }

        .ci-error-title{
            font-family: Arial, Helvetica, sans-serif;
            font-style: normal;
            font-weight: bold;
            font-size: 36px;   
            color: #383838;  
            text-align: center;   
            margin: 10px 0px;  
        }

        .ci-error-content p {
            font-family: Arial, Helvetica, sans-serif;
            font-weight: normal;
            font-size: 16px;
            text-align: center;
            margin: 10px 0;

            color: #171717;
        }

        .ci-error-content .ci-button{
            margin: 0 7px;
            
            min-width: 178px;
            outline: none;
            display: block;
            padding: 0 22px;
            text-align: center;
            white-space: nowrap;
            vertical-align: middle;
            -ms-touch-action: manipulation;
            touch-action: manipulation;
            cursor: pointer;
            -webkit-user-select: none;
            -moz-user-select: none;
            -ms-user-select: none;
            user-select: none;
            border: none;
            border-radius: 25px;
            line-height: 32px;
            height: 32px;
            background: #E9F0FC;
            color: #366FE0;
            border: none;

            font-weight: 600;
            font-size: 16px;            
        }

        .ci-error-content .ci-button:hover{
            background-color: #d8e7ff;
            box-shadow: 0px 1px 6px 1px rgb(105 109 112 / 10%);
        }

        .ci-error-buttons{
            display: flex;
            align-items: center;
            margin-top: 20px;
            justify-content: center;
        }
    </style>

</head>
